import web from "../src/images/logo.png";
import app from "../src/images/android.jpg";
import android from "../src/images/digital.jpg";
import digital from "../src/images/marketing.jpg";
import marketing from "../src/images/Robots-Square.jpg";
import software from "../src/images/software.jpg";

const Sdata=[
    {
        imgsrc:web,
        title:"web development",
    },
    {
        imgsrc:app,
        title:"app development",
    },
    {
        imgsrc:software,
        title:"software development", 
    },
    {
        imgsrc:digital,
        title:"Digital Marketing",
    },
    {
        imgsrc:android,
        title:"Android development",
    },
    {
        imgsrc:marketing,
        title:"Marketing",
    }
];

export default Sdata;
